import { Album } from "./Album"
import { Cancion } from "./Cancion"
import {Grupo} from './Grupo';
import {Artista} from './Artista';

export class GeneroMusical{
    private genreName:string
    private artistas: Artista[]
    private grupos: Grupo[]
    private albumes: Album[]
    private canciones: Cancion[]

    /**
     * constructor de la clase GeneroMusical, crea un nuevo genero comprobando que los elementos que se le pasa pertenecen a ese genero en concreto
     * @param name nombre del genero
     * @param art artistas que pertenecen al genero
     * @param grup grupos que pertenecen al genero
     * @param alb albumes que pertenecen al genero
     * @param can canciones que pertenecen al genero
     */
    constructor(name:string,art:Artista[],grup:Grupo[],alb:Album[],can:Cancion[]){
        this.genreName = name
        this.artistas = art
        this.grupos = grup
        for(let i = 0; i <= alb.length; i++){
            for(let j = 0; j <= alb[i].getGenre().length; j++){
                if(this.genreName == alb[i].getGenre()[j].getName()){
                    this.albumes.push(alb[i])
                    break
                } 
            }
        }
        //this.albumes = alb
        for(let i = 0; i <= can.length; i++){
            for(let j = 0; j <= can[i].getGeneros().length; j++){
                if(this.genreName == alb[i].getGenre()[j].getName()){
                    this.canciones.push(can[i])
                } 
            }
        }
        //this.canciones = can
    }

    /**
     * getter para el nombre del genero
     * @returns el nombre del genero
     */
    getName():string{
        return this.genreName
    }

    /**
     * getter para los artistas de un genero
     * @returns el array con los artistas de un genero
     */
    getArtistas():Artista[]{
        return this.artistas
    }

    /**
     * getter para los grupos de un genero
     * @returns el array con los grupos de un genero
     */
    getGrupos():Grupo[]{
        return this.grupos 
    }

    /**
     * getter para los albumes de un genero
     * @returns el array con los albumes de un genero
     */
    getAlbumes():Album[]{
        return this.albumes
    }

    /**
     * getter para las canciones de un genero
     * @returns el array con las canciones
     */
    getCanciones():Cancion[]{
        return this.canciones
    }

    /**
     * setter del nombre
     * @param name nuevo nombre del genero musical
     */
    setGenNam(name:string){
        this.genreName = name
    }

    /**
     * metodo que añade un artista al array de artistas del genero
     * @param art artista que va a ser añadido al genero
     */
    addArtista(art:Artista):void{
        for(let i:number = 0; i <= this.artistas.length;i++){
            if(this.artistas[i].getNombre() == art.getNombre()){
                console.log("este artista ya esta añadido a la lista del genero")
                return
            }
        }
        for(let i = 0; i <= art.getGeneros().length; i++){
            if(this.getName() == art.getGeneros()[i].getName()){
                this.artistas.push(art)
                return
            }
        }
        console.log("el artista no fue añadido porque no pertenecia a este genero")
    }

    /**
     * metodo que añade un grupo al array de grupos del genero
     * @param gru grupo que va a ser añadido
     */
    addGrupo(gru:Grupo):void{
        for(let i:number = 0; i <= this.grupos.length;i++){
            if(this.grupos[i].getNombre() == gru.getNombre()){
                console.log("este grupo ya esta añadido a la lista del genero")
                return
            }
        }
        for(let i = 0; i <= gru.getGeneros().length; i++){
            if(this.getName() == gru.getGeneros()[i].getName()){
                this.grupos.push(gru)
                return
            }
        }
        console.log("el grupo no fue añadido porque no pertenecia a este genero")
    }

    /**
     * metodo que añade un album a la lista del genero
     * @param alb el album que se va a añadir
     */
    addAlbum(alb:Album):void{
        for(let i:number = 0; i <= this.albumes.length;i++){
            if(this.albumes[i].getName() == alb.getName()){
                console.log("este album ya esta añadido a la lista del genero")
                return
            }
        }
        for(let i:number = 0; i <= alb.getGenre().length;i++){
            if(this.genreName == alb.getGenre()[i].getName()){
                this.albumes.push(alb)
                return
            }
        }
        console.log("el album no fue añadido porque no pertenecia a este genero")
    }

    /**
     * metodo que añade una cancion a la lista del genero
     * @param can la cancion que se va a añadir
     */
    addCancion(can:Cancion):void{
        for(let i:number = 0; i <= this.canciones.length;i++){
            if(this.canciones[i].getName() == can.getName()){
                console.log("esta cancion ya esta añadida a la lista del genero")
                return
            }
        }
        for(let i:number = 0; i <= can.getGeneros().length;i++){
            if(this.genreName == can.getGeneros()[i].getName()){
                this.canciones.push(can)
                return
            }
        }
        console.log("la cancion no fue añadida porque no pertenecia a este genero")
    }

    /**
     * metodo que borra del array de grupos un grupo
     * @param gru grupo que se quiere borrar
     */
    delGrupo(gru:Grupo){
        for(let i:number = 0; i <= this.grupos.length;i++){
            if(this.grupos[i].getNombre() == gru.getNombre()){
                this.grupos.splice(i,1)
                return
            }
        }
        console.log("No se puede borrar el grupo porque no pertenece al genero")
    }

    /**
     * metodo que borra del array de artistas un artista
     * @param art artista que se quiere borrar
     */
    delArt(art:Artista){
        for(let i:number = 0; i <= this.artistas.length;i++){
            if(this.artistas[i].getNombre() == art.getNombre()){
                this.artistas.splice(i,1)
                return
            }
        }
        console.log("No se puede borrar el artista porque no pertenece al genero")
    }

    /**
     * metodo que borra del array de canciones una cancion
     * @param can cancion que se quiere borrar
     */
    delCanc(can:Cancion){
        for(let i:number = 0; i <= this.canciones.length;i++){
            if(this.canciones[i].getName() == can.getName()){
                this.canciones.splice(i,1)
                return
            }
        }
        console.log("No se puede borrar la cancion porque no pertenece al genero")
    }

    /**
     * metodo que borra del array del albumes un album
     * @param alb album que se quiere borrar
     */
    delAlbum(alb:Album){
        for(let i:number = 0; i <= this.albumes.length;i++){
            if(this.albumes[i].getName() == alb.getName()){
                this.albumes.splice(i,1)
                return
            }
        }
        console.log("No se puede borrar el grupo porque no pertenece al genero")
    }
}

import { Cancion } from "./Cancion"
import { GeneroMusical } from "./GeneroMusical"
import {Grupo} from './Grupo';
import {Artista} from './Artista';

export class Album{
    private albumName: string
    private autor: Artista | Grupo
    private año: number
    private generos: GeneroMusical[]
    private canciones:Cancion[]

    /**
     * constructor de la clase album
     * @param name nombre del album
     * @param au autor del album
     * @param ye año de publicacion del album
     * @param gen generos del album
     * @param can canciones del album
     */
    constructor(name:string, au: Artista|Grupo,ye:number,gen:GeneroMusical[],can:Cancion[]){
        this.albumName = name
        this.autor = au
        this.año = ye
        this.generos = gen
        for(let i:number = 0; i <= can.length; i++){
            if(can[i].getSingle() == false){
                this.canciones.push(can[i])
            }
        }
    }

    /**
     * getter del nombre del album
     * @returns el nombre del album
     */
    getName():string{
        return this.albumName
    }

    /**
     * getter con el autor del album
     * @returns el Artista/Grupo autor del album
     */
    getAutor():Artista|Grupo{
        return this.autor
    }

    /**
     * getter del año en que salio el album
     * @returns el año de salida del album
     */
    getYear():number{
        return this.año
    }

    /**
     * getter de los generos del album
     * @returns un array con todos los generos del album
     */
    getGenre():GeneroMusical[]{
        return this.generos
    }

    /**
     * getter de las canciones del album
     * @returns un array con todas las canciones del album
     */
    getCancion():Cancion[]{
        return this.canciones
    }

    /**
     * setter del nombre del album
     * @param nam nuevo nombre del album
     */
    setName(nam:string){
        this.albumName = nam
    }

    /**
     * setter para el autor del album
     * @param aut nuevo autor del album
     */
    setAutor(aut: Artista|Grupo){
        this.autor = aut
    }

    /**
     * setter para el año de publicacion
     * @param año nuevo año de publicacion
     */
    setAño(año:number){
        this.año = año
    }

    /**
     * metodo que añade un genero musical al array de generos
     * @param gen nuevo genero a añadir
     */
    addGen(gen:GeneroMusical){
        for(let i:number = 0; i <= this.generos.length; i++){
            if(this.generos[i].getName() == gen.getName()){
                console.log("El genero ya esta añadido al album")
                return
            }
        }
        this.generos.push(gen)
    }

    /**
     * metodo que añade una cancion al array de canciones
     * @param can cancion que se va añadir
     */
    addCanc(can:Cancion){
        for(let i:number = 0; i <= this.canciones.length; i++){
            if(this.canciones[i].getName() == can.getName()){
                console.log("La cancion ya esta añadido al album")
                return
            }
        }
        this.canciones.push(can)
    }

    /**
     * metodo que borra un genero musical del array de generos
     * @param gen genero que se va a borrar
     */
    delGen(gen:GeneroMusical){
        for(let i:number = 0; i <= this.generos.length; i++){
            if(this.generos[i].getName() == gen.getName()){
                this.generos.splice(i,1)
                return
            }
        }
        console.log("El genero no pertenece al album")
    }

    /**
     * metodo que borra una cancion del array de canciones
     * @param can cancion que se va a borrar
     */
    delCanc(can:Cancion){
        for(let i:number = 0; i <= this.canciones.length; i++){
            if(this.canciones[i].getName() == can.getName()){
                this.canciones.splice(i,1)
                return
            }
        }
        console.log("La cancion no pertenece al album al album")
    }
}

import { GeneroMusical } from "./GeneroMusical"

export class Cancion{
    private songName: string
    private autor: string
    private duracion: number[]
    private generos: GeneroMusical[]
    private single: boolean
    private reproduccionTo:number

    /**
     * constructor de la clase cancion
     * @param name nombre de la cancion
     * @param au autor de la cancion
     * @param du duracion de la cancion
     * @param ge generos de la cancion
     * @param si flag que permite saber si la cancion es un single
     * @param re reproducciones totales de la cancion
     */
    constructor(name:string, au:string, du: number[], ge:GeneroMusical[], si:boolean, re:number){
        this.songName = name
        this.autor = au
        if(du.length > 2){
            console.error("la duracion de la cancion tiene que estar en minutos y segundos")
        }
        else{
            this.duracion = du
            while(this.duracion[1] >= 60){
                this.duracion[1] = this.duracion[1] - 60
                this.duracion[0]++
            }
        }
        this.generos = ge
        this.single = si
        this.reproduccionTo = re
    }

    /**
     * getter del nombre
     * @returns el nombre de la cancion
     */
    getName():string{
        return this.songName
    }

    /**
     * getter del autor
     * @returns devuelve el autor de la cancion
     */
    getAutor():string{
        return this.autor
    }

    /**
     * getter de la duracion 
     * @returns la duracion de la cancion en minutos y segundos
     */
    getDuration():number[]{
        return this.duracion
    }

    /**
     * getter de los generos de la cancion
     * @returns un array con los generos que tiene una cancion
     */
    getGeneros():GeneroMusical[]{
        return this.generos
    }

    /**
     * getter del flag Single
     * @returns devuelve true si la cancion es un single o false en caso contrario
     */
    getSingle():boolean{
        return this.single
    }

    /**
     * getter de las reproducciones
     * @returns devuelve el numero de reproducciones totales
     */
    getRepro():number{
        return this.reproduccionTo
    }

    /**
     * setter del nombre
     * @param name nuevo nombre del genero musical
     */
    setName(nam:string){
        this.songName = nam
    }

    /**
     * setter para el autor de la cancion
     * @param aut nuevo autor de la cancion
     */
    setAut(aut:string){
        this.autor = aut
    }

    /**
     * setter de la duracion
     * @param dur nueva duracion
     */
    setDur(dur:number[]){
        if(dur.length != 2){
            console.error("la duracion introducida no es correcta")
        }
        else{
            this.duracion = dur
            while(this.duracion[0] >= 60){
                this.duracion[0] -= 60
                this.duracion[1]++
            }
        }
    }

    /**
     * metodo que añade un genero musical al array de generos
     * @param gen genero que se va a añadir
     */
    addGen(gen:GeneroMusical){
        for(let i:number = 0; i <= this.generos.length; i++){
            if(this.generos[i].getName() == gen.getName()){
                console.log("La cancion ya pertenece al genero")
                return
            }
        }
        this.generos.push(gen)
    }

    /**
     * metodo que borra un genero musical del array de generos
     * @param gen genero que se va a borrar
     */
    delGen(gen:GeneroMusical){
        for(let i:number = 0; i <= this.generos.length; i++){
            if(this.generos[i].getName() == gen.getName()){
                this.generos.splice(i,1)
                return
            }
        }
        console.log("El artista no pertenece al genero")
    }

    /**
     * setter que cambia el flag single de una cancion
     */
    setSing(){
        this.single = !this.single
    }

    /**
     * metodo que añade reproducciones a las reproducciones totales
     * @param rep reproducciones que se van a añadir
     */
    addRep(rep:number = 1){
        this.reproduccionTo += rep
    }

    /**
     * setter para las reproducciones totales
     * @param rep nuevas reproduccion totales
     */
    setRep(rep:number){
        this.reproduccionTo = rep
    }
}
